import React from "react";
import { Box, Card, Typography, Grid } from "@mui/material";
import { useMediaQuery } from "@mui/material";
import { useTheme } from "@mui/material";

import security from "../assets/icons/security.png";
import shield from "../assets/icons/shield.png";
import helpDesk from "../assets/icons/help-desk.png";
import cashlessPayment from "../assets/icons/cashless-payment.png";

import FacebookIcon from "@mui/icons-material/Facebook";
import TwitterIcon from "@mui/icons-material/Twitter";
import RedditIcon from "@mui/icons-material/Reddit";
import YouTubeIcon from "@mui/icons-material/YouTube";

import { Link } from "react-router-dom";

export const Footer = () => {
    const theme = useTheme();
    const matchDownMd = useMediaQuery(theme.breakpoints.down("sm"));

    return (
        <div style={{ marginTop: "50px" }}>
            <Grid
                container
                sx={{
                    padding: { xs: 0, lg: "0 176px" },
                }}
                spacing={2}
            >
                <Grid
                    item
                    xs={12}
                    lg={3}
                    sx={{ display: "flex", justifyContent: "center" }}
                >
                    <Card
                        className={"box-footer"}
                        sx={{
                            height: "150px",
                            width: "250px",
                            padding: "20px",
                            display: "flex",
                            justifyContent: "center",
                            alignItems: "center",
                            flexDirection: "column",
                            textAlign: "center",
                            borderRadius: 0,
                        }}
                    >
                        <img
                            src={security}
                            alt="security"
                            width={"70px"}
                            height={"70px"}
                            style={{ margin: "10px 0" }}
                        />
                        <Typography sx={{ margin: "10px 0", fontSize: "16px" }}>
                            <b>100% SECURE PAYMENTS</b>
                        </Typography>
                        <Typography sx={{ fontSize: "12px" }}>
                            Moving your card details to a much more secure
                            place.
                        </Typography>
                    </Card>
                </Grid>
                <Grid
                    item
                    xs={12}
                    lg={3}
                    sx={{ display: "flex", justifyContent: "center" }}
                >
                    <Card
                        className={"box-footer"}
                        sx={{
                            height: "150px",
                            width: "250px",
                            padding: "20px",
                            display: "flex",
                            justifyContent: "center",
                            alignItems: "center",
                            flexDirection: "column",
                            textAlign: "center",
                            borderRadius: 0,
                        }}
                    >
                        <img
                            src={shield}
                            alt="shield"
                            width={"70px"}
                            height={"70px"}
                            style={{ margin: "10px 0" }}
                        />
                        <Typography sx={{ margin: "10px 0", fontSize: "16px" }}>
                            <b>TRUSTPAY</b>
                        </Typography>
                        <Typography sx={{ fontSize: "12px" }}>
                            100% Payment Protection. Easy Return Policy.
                        </Typography>
                    </Card>
                </Grid>
                <Grid
                    item
                    xs={12}
                    lg={3}
                    sx={{ display: "flex", justifyContent: "center" }}
                >
                    <Card
                        className={"box-footer"}
                        sx={{
                            height: "150px",
                            width: "250px",
                            padding: "20px",
                            display: "flex",
                            justifyContent: "center",
                            alignItems: "center",
                            flexDirection: "column",
                            textAlign: "center",
                            borderRadius: 0,
                        }}
                    >
                        <img
                            src={helpDesk}
                            alt="helpDesk"
                            width={"70px"}
                            height={"70px"}
                            style={{ margin: "10px 0" }}
                        />
                        <Typography sx={{ margin: "10px 0", fontSize: "16px" }}>
                            <b>HELP CENTER</b>
                        </Typography>
                        <Typography sx={{ fontSize: "12px" }}>
                            Got a question? Look no further. Submit your query
                            here.
                        </Typography>
                    </Card>
                </Grid>
                <Grid
                    item
                    xs={12}
                    lg={3}
                    sx={{ display: "flex", justifyContent: "center" }}
                >
                    <Card
                        className={"box-footer"}
                        sx={{
                            height: "150px",
                            width: "250px",
                            padding: "20px",
                            display: "flex",
                            justifyContent: "center",
                            alignItems: "center",
                            flexDirection: "column",
                            textAlign: "center",
                            borderRadius: 0,
                        }}
                    >
                        <img
                            src={cashlessPayment}
                            alt="cashlessPayment"
                            width={"70px"}
                            height={"70px"}
                            style={{ margin: "10px 0" }}
                        />
                        <Typography sx={{ margin: "10px 0", fontSize: "16px" }}>
                            <b>SHOP ON THE GO</b>
                        </Typography>
                        <Typography sx={{ fontSize: "12px" }}>
                            Download the app and get exciting app only offers at
                            your fingertip.
                        </Typography>
                    </Card>
                </Grid>
            </Grid>
            <Grid
                container
                sx={{
                    padding: { xs: 0, lg: "30px 180px 50px 180px" },
